void init_pop(ROUTE_DATA_TYPE *pop, city_coords *cities, int *fit, FILE *fp, int last_fit)
{
    ROUTE_DATA_TYPE *tmp;
    std::vector<ROUTE_DATA_TYPE> myvector;
    for (int k=0; k < N; k++) myvector.push_back(k); // 1 2 3 4 5 6 7 8 9

    random_shuffle ( myvector.begin(), myvector.end() );

    if(NN==1)
        nearest_neighbor_init(myvector, cities);

    tmp = &myvector[0];
    cudaMemcpy       (pop, tmp , N * sizeof(ROUTE_DATA_TYPE),cudaMemcpyHostToDevice);
    //printf("Route:%ld\n", routeLength(myvector, cities));
    last_fit = routeLength(myvector, cities);
    fprintf(fp,"%ld,", routeLength(myvector, cities));
    //fprintf(ws_fp,"%d,",4);
}

int countcity(char *fn)
{
    int tmp;
    float a,b;
    FILE *fc;
    if ((fc=fopen(fn,"r"))==NULL)
    {
        printf("open file %s error\n",fn);
        exit(0);
    }

    int i = 0;
    while(fscanf(fc, "%d %f %f", &tmp, &a, &b) != EOF) {i++;}
    return i;
}

__global__ void printt(best2_out *out)
{
    printf("%d %d %d\n",out->i, out->j, out->minchange);
}

void readcity_coords(city_coords *cities, char *fn)
{
    int tmp;
    FILE *fc;
    strcat (fn,".tsp");


    if ((fc=fopen(fn,"r"))==NULL)
    {
        printf("1open file %s error\n",fn);
        exit(0);
    }

    int i = 0;
    while(fscanf(fc, "%d %f %f", &tmp, &cities[i].x, &cities[i].y) != EOF) {i++;}
}

__global__ void orderRouteAssign(ROUTE_DATA_TYPE *pop, city_coords *cities, city_coords *device_coords, int N)//, int win_size[0], int seg, int offset)
{
    int x = threadIdx.x + blockIdx.x * blockDim.x;
    int y = threadIdx.y + blockIdx.y * blockDim.y;
    int id = x + y * blockDim.x * gridDim.x;
    //+offset+win_size[0]*seg

    if(id < N)//win_size[0])
    {
        device_coords[id].x = cities[ pop[ id ] ].x;
        device_coords[id].y = cities[ pop[ id ] ].y;
    }
}


__global__ void inversion(ROUTE_DATA_TYPE *pop, best2_out *out, int win_size, int seg)
{
    if(out->minchange < 0)
    {
        int x = threadIdx.x + blockIdx.x * blockDim.x;
        int y = threadIdx.y + blockIdx.y * blockDim.y;
        int id = x + y * blockDim.x * gridDim.x;
    
        int pos_i = (min(out->i, out->j))   + win_size*seg;
        int pos_j = (max(out->i, out->j)-1) + win_size*seg;
        int len = pos_j - pos_i + 1;

        if(id < len/2)
        {
            int tmp;
            tmp                              = pop[ id + pos_i ];
            pop[ id + pos_i ]                = pop[ id + pos_i + len - (id*2+1) ];
            pop[ id + pos_i + len - (id*2+1) ] = tmp;
        }
    }
}

__global__ void inversion_final_segment(ROUTE_DATA_TYPE *pop, best2_out *out, int win_size, int seg)
{
    if(out->minchange < 0)
    {
        int x = threadIdx.x + blockIdx.x * blockDim.x;
        int y = threadIdx.y + blockIdx.y * blockDim.y;
        int id = x + y * blockDim.x * gridDim.x;
    
        int pos_i = (min(out->i, out->j))   + win_size*seg;
        int pos_j = (max(out->i, out->j)-1) + win_size*seg;
        int len = pos_j - pos_i + 1;

        if(id < len/2)
        {
            int tmp;
            tmp                              = pop[ id + pos_i ];
            pop[ id + pos_i ]                = pop[ id + pos_i + len - (id*2+1) ];
            pop[ id + pos_i + len - (id*2+1) ] = tmp;
        }
    }
}

void callKernel2opt(ROUTE_DATA_TYPE *pop, city_coords *cities, city_coords *h_cities, int *dev_mutex, best2_out *device_out_2opt, city_coords *device_coords, int *fit, ROUTE_DATA_TYPE *h_pop, best2_out zero, vector < ROUTE_DATA_TYPE > &Vector, int *win_size, best2_out h_out, float sita, float power)
{
    //cudaDeviceSychronize();
    //int win_size[0] = 200;
    int number_segment = N / win_size[0];
    int change_seg = 0;
    ROUTE_DATA_TYPE *tmp;

    unsigned long _number_of_2opts = (long) (win_size[0] - 3) * (long) (win_size[0] - 2) / 2;
    unsigned int  _iterations = (_number_of_2opts / (1024 * 64) ) + 1;

    Vector.clear();
    for(int i=0;i<N;i++)
        Vector.push_back( h_pop[i]);
    int offset = rand()%N;
    std::rotate(Vector.begin(), Vector.begin()+offset, Vector.end());
    tmp = &Vector[0];
    cudaMemcpy       (pop, tmp , N * sizeof(ROUTE_DATA_TYPE),cudaMemcpyHostToDevice);

    orderRouteAssign    <<<iDivUp(N, 32),32>>>(pop, cities, device_coords, N);
    for(int i = 0; i < number_segment; i++)
    {
        cudaMemset (dev_mutex, 0, sizeof (int) );
        cudaMemcpy (device_out_2opt, &zero, sizeof (struct best2_out), cudaMemcpyHostToDevice);
            
        if(win_size[0] < 4096)
            kernel2opt_mine <<< 64, 1024 >>> (&device_coords[i*win_size[0]], win_size[0], _number_of_2opts, _iterations, dev_mutex, device_out_2opt);
        else
            kernel2opt_extended_mine <<< 64, 1024 >>> (&device_coords[i*win_size[0]], win_size[0], dev_mutex, device_out_2opt);
        
        cudaMemcpy (&h_out, device_out_2opt, sizeof (struct best2_out), cudaMemcpyDeviceToHost);
      
        if(h_out.minchange>=0)
            change_seg++;
        inversion   <<<iDivUp(N, 32),32>>>(pop, device_out_2opt, win_size[0], i);
    
    }
    if(N % win_size[0] != 0 && N % win_size[0] > 3)
    {
        int SL = N % win_size[0];
        _number_of_2opts = (long) (SL - 3) * (long) (SL - 2) / 2;
        _iterations = (_number_of_2opts / (1024 * 64) ) + 1;
        cudaMemset (dev_mutex, 0, sizeof (int) );
        cudaMemcpy (device_out_2opt, &zero, sizeof (struct best2_out), cudaMemcpyHostToDevice);

        if(SL < 4096)
            kernel2opt_mine <<< 64, 1024 >>> (&device_coords[number_segment*win_size[0]], SL, _number_of_2opts, _iterations, dev_mutex, device_out_2opt);
        else
            kernel2opt_extended_mine <<< 64, 1024 >>> (&device_coords[number_segment*win_size[0]], SL, dev_mutex, device_out_2opt);
        
        cudaMemcpy (&h_out, device_out_2opt, sizeof (struct best2_out), cudaMemcpyDeviceToHost);
      
        if(h_out.minchange>=0)
            change_seg++;
        inversion_final_segment   <<<iDivUp(N, 32),32>>>(pop, device_out_2opt, win_size[0], number_segment);

    }
   /*
    if(change_seg/(float)number_segment > sita)
    {
        win_size[0]*=power;

        if(win_size[0]>=N)
            win_size[0] = N;
    }
    */
}

