        sprintf(runtime_filename,"./output_rw/%s/gpu_intra_3thread_runtime_s2OPT_TSP_N%d_INWS%d_power%d_sita%f_T%d.csv",argv[6],N,WIN_SIZE, power,sita,number_gen);
    }
    if(NN==1)
    {
        sprintf(filename,"./output_rw/%s/NN_gpu_intra_3thread_s2OPT_TSP_N%d_INWS%d_power%d_sita%f_T%d.csv",argv[6],N,WIN_SIZE,  power,sita,number_gen);
        sprintf(ws_filename,"./output_rw/%s/NN_gpu_intra_3thread_WS_s2OPT_TSP_N%d_INWS%d_power%d_sita%f_T%d.csv",argv[6],N,WIN_SIZE, power,sita,number_gen);
        sprintf(runtime_filename,"./output_rw/%s/NN_gpu_intra_3thread_runtime_s2OPT_TSP_N%d_INWS%d_power%d_sita%f_T%d.csv",argv[6],N,WIN_SIZE, power,sita,number_gen);
    }

    ws_fp=fopen(ws_filename,"w+");
    fp=fopen(filename,"w+");
    runtime_fp=fopen(runtime_filename,"w+");

    srand(time(NULL));
    curandState *devState;

    city_coords *cities, *d_cities;

    gpuErrchk( cudaMalloc((void**)&d_cities, N*sizeof(city_coords)));
    cities = (city_coords*) malloc( N * sizeof(city_coords));
    readcity_coords(cities, argv[6]);
    ROUTE_DATA_TYPE *h_pop = new ROUTE_DATA_TYPE [N];

    cudaMemcpy       (d_cities, cities , N*sizeof(city_coords),cudaMemcpyHostToDevice);

    ///////////////////for 2opt//////////////////////
    std::vector<ROUTE_DATA_TYPE> Vector;
    int *dev_mutex;
    int *win_size = new int [1];
    cudaMalloc (&dev_mutex, sizeof (int) );
    struct best2_out *device_out_2opt;
    struct best2_out h_out;
    struct best2_out zero;
    zero.minchange =0;
    zero.i=0;
    zero.j=0;
    cudaMalloc ( (void **) &device_out_2opt, sizeof (struct best2_out) );
    city_coords *device_coords;
    cudaMalloc ( (void **) &device_coords, sizeof (city_coords) * N);
    ////////////////////////////////////////////////
    ROUTE_DATA_TYPE *d_pop;
    gpuErrchk( cudaMalloc((void**)&d_pop, N*sizeof(ROUTE_DATA_TYPE)));    
    int *fit, *inverse_or_not;
    ROUTE_DATA_TYPE *inversion_pos_i, *inversion_pos_j;
    gpuErrchk( cudaMalloc((void**)&fit, sizeof(int)));
    gpuErrchk( cudaMalloc((void**)&inversion_pos_i,  (N/WIN_SIZE)*sizeof(ROUTE_DATA_TYPE)));
    gpuErrchk( cudaMalloc((void**)&inversion_pos_j,  (N/WIN_SIZE)*sizeof(ROUTE_DATA_TYPE)));
    gpuErrchk( cudaMalloc((void**)&inverse_or_not, (N/WIN_SIZE)*sizeof(int)));
    
    long int last_fitness=0;
    init_pop(d_pop, cities, fit,fp, last_fitness);
    
    int run_time = FE;


    clock_t start,record_start;
    start = clock();
    double duration = 0;

    long int fitness;
    long int old_fitness;
    long int best_trail = 2147483647;

    int **final_pop;
    final_pop = (int**) malloc( 10000 * sizeof(int*));
    for(int i = 0; i < 10000; i++)
        final_pop[i] = (int*) malloc(N * sizeof(int));
    int gen=0;
    int gen_child=0;

    for(int trial=0;trial<run_time;trial++)
    {
        
        init_pop(d_pop, cities, fit,fp, last_fitness);

        start = clock();
        record_start = clock();

        int times = number_gen;    
        win_size[0] = WIN_SIZE;
        win_size[0] = N/3;
        //printf("asd:%d\n",win_size[0]);
        gen=0;
        gen_child=0;
        while(times--)
        {
            cudaMemcpy (h_pop, d_pop, N * sizeof (ROUTE_DATA_TYPE), cudaMemcpyDeviceToHost);
            for(int i=0;i<N;i++)
            Vector.push_back( h_pop[i]);
            old_fitness = routeLength(Vector, cities);
            Vector.clear();    


            if(win_size[0]>=N)
                win_size[0] = N;
            callKernel2opt(d_pop, d_cities, cities, dev_mutex, device_out_2opt, device_coords, fit, h_pop, zero, Vector, win_size, h_out, sita, power);
                
            cudaMemcpy       (h_pop, d_pop , N*sizeof(ROUTE_DATA_TYPE),cudaMemcpyDeviceToHost);
            Vector.clear();  
            for(int i=0;i<N;i++)
                Vector.push_back( h_pop[i]);
    
            fitness = routeLength(Vector, cities);
            
            //printf("%ld ",fitness);
            fprintf(fp,"%ld,",fitness);
            fprintf(ws_fp,"%d,",win_size[0]);
            fprintf(runtime_fp,"%lf,", ( clock() - record_start ) / (double) CLOCKS_PER_SEC);
            fflush(fp);
            fflush(runtime_fp);
            Vector.clear();    
            fflush(stdout);

            if(gen%100==0)
            {
                for(int m=0;m<N;m++)
                    final_pop[gen_child][m] = h_pop[m];
                    gen_child++;
            }

            if(old_fitness==fitness)
                break; 
            gen++;

        }
        for(int m=0;m<N;m++)
            final_pop[gen_child][m] = h_pop[m];
        gen_child++;

        duration = ( clock() - start ) / (double) CLOCKS_PER_SEC;

       

        //fprintf(pop_fp,"\n");
        fprintf(fp,"\n");
        fprintf(ws_fp,"\n");
        fprintf(runtime_fp,"\n");
        cout<<"times: "<< duration << " " <<" "<<"RUN_TIME"<<trial<<" ";
        if(NN==0)
            printf("gpu_intra_3thread_s2OPT_TSP_N%d_INWS%d_power%d_sita%f_T%d\n",N,WIN_SIZE,  power,sita,number_gen);
        if(NN==1)
            printf("NN_gpu_intra_3thread_s2OPT_TSP_N%d_INWS%d_power%d_sita%f_T%d\n",N,WIN_SIZE,  power,sita,number_gen);

            //fflush(stdout);
    
    }
    fclose(fp);
}


